features.script:
// Unnecessary, videos and audio have an `autoplay` function
parcel.on('playerenter', () => {
  feature.play()
})

setInterval(() => {
  let p = parcel.getPlayers()[0]

  if (!p) {
    return
  }

  let v1 = feature.position
  let v2 = p.position
  let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x)

  feature.rotation.y = Math.PI / -2 - angle
}, 200)
